	internal class PurpleValueConverter : JsonConverter
	{
		public override bool CanConvert(Type t) => t == typeof(PurpleValue) || t == typeof(PurpleValue?);

		public override object ReadJson(JsonReader reader, Type t, object existingValue, JsonSerializer serializer)
		{
			switch (reader.TokenType)
			{
				case JsonToken.String:
				case JsonToken.Date:
					var stringValue = serializer.Deserialize<string>(reader);
					switch (stringValue)
					{
						case "#00000000":
							return new PurpleValue { Enum = ValueEnum.The00000000 };
						case "#000000FF":
							return new PurpleValue { Enum = ValueEnum.The000000Ff };
						case "#07A3B8FF":
							return new PurpleValue { Enum = ValueEnum.The07A3B8Ff };
						case "#808080FF":
							return new PurpleValue { Enum = ValueEnum.The808080Ff };
						case "#FF0000FF":
							return new PurpleValue { Enum = ValueEnum.Ff0000Ff };
						case "#FFFFFFFF":
							return new PurpleValue { Enum = ValueEnum.Ffffffff };
