					case ValueEnum.The00000000:
						serializer.Serialize(writer, "#00000000");
						return;
					case ValueEnum.The000000Ff:
						serializer.Serialize(writer, "#000000FF");
						return;
					case ValueEnum.The07A3B8Ff:
						serializer.Serialize(writer, "#07A3B8FF");
						return;
					case ValueEnum.The808080Ff:
						serializer.Serialize(writer, "#808080FF");
						return;
					case ValueEnum.Ff0000Ff:
